<template>
	<view class="login-content">
		<view class="topImg">
			<img src="../../static/images/2_01.png" alt="">
		</view>
		<view class="loginlist">
			<view class="username">
				<view class="top">
					<img src="../../static/images/qie_0004_手机.png" alt="">
					<text>用户名</text>
				</view>
				<view class="usernameInput">
					<form action="">
						<input type="text" v-model="loginInfo.username" @blur.stop="changeUsername" @focus="getUsername">
					</form>
				</view>
			</view>
			<view class="password">
				<view class="top">
					<img src="../../static/images/qie_0003_密码.png" alt="">
					<text>密码</text>
				</view>
				<view class="passwordInput"  v-if="canLook === false">
					<input type="password" v-model="loginInfo.password" @blur="changePassword">
					<img src="../../static/images/qie_0002_del删除.png" alt="" class="img1" @click="removePassword">
					<img src="../../static/images/qie_0005_密码不可见.png" alt="" class="img2" @click="canLook = true">
				</view>
				<view class="passwordInput" v-else>
					<input type="text" v-model="loginInfo.password" @blur="changePassword">
					<img src="../../static/images/qie_0002_del删除.png" alt="" class="img1" @click="removePassword">
					<img src="../../static/images/qie_0005_密码可见.png" alt="" class="img2" @click="canLook = false">
				</view>
			</view>
			<view class="forgetPassword">
				<!-- <text>忘记密码?</text> -->
			</view>
			<view class="register" @click="goregister">
				<text>登录</text>
			</view>
		</view>
	</view>
</template>

<script>
	export default{
		onLoad() {
			// #ifdef H5
			let token = localStorage.getItem('token')
			if(token !== null && token !== undefined && token !== ''){
				this.$http.post('/api/warehouse/verifyToken',{
					token:token
				}).then(response =>{
					if(response.code !== 200){
						localStorage.removeItem('token')
					}else{
						uni.showToast({
							title:'您已经登陆,无需重复登录',
							duration: 1000,
							icon:'none'
						}),
						setTimeout(()=>{
							uni.redirectTo({
								url:'/pages/index/index'
							})
						},1100)
					}
				})
			}
			// #endif
		},
		data(){
			return{
				token1:null,
				canLook:false,
				loginInfo:{
					username:'',
					password:''
				},
				loginRealInfo:{
					phone:'',
					password:''
				},
			}
		},
		methods:{
			changeUsername(){
				if(this.loginInfo.username.length === 11){
					if(!(/^1[3456789]\d{9}$/.test(this.loginInfo.username))){ 
						uni.showToast({
							title:"手机号有误,请重新填写",
							icon:"none"
						})
						this.loginInfo.username = ''
						this.loginRealInfo.phone = ''
						return false; 
					} 
					this.loginRealInfo.phone = this.loginInfo.username
					let a = this.loginInfo.username.slice(0,3)
					let c = this.loginInfo.username.substr(this.loginInfo.username.length - 4);
					this.loginInfo.username = a + "****" + c	
				}else{
					uni.showToast({
						title:"手机号长度有误,请重新填写",
						icon:"none"
					})
					this.loginInfo.username = ''
					this.loginRealInfo.phone = ''
				}
			},
			getUsername(){
				this.loginInfo.username = this.loginRealInfo.phone
			},
			removeUsername(){
				this.loginInfo.username = ''
			},
			removePassword(){
				this.loginInfo.password = ''
			},
			changePassword(){
				this.loginRealInfo.password = this.loginInfo.password
			},
			goregister(){
				this.loginRealInfo.password = this.loginInfo.password
				this.$http.post('/api/warehouse/login',this.loginRealInfo).then(response => {
					if(response.code === 200){
						// #ifdef H5
						localStorage.token = response.data.token
						// #endif
						// #ifdef MP-WEIXIN
						wx.setStorage({
						  key:"token",
						  data:response.data.token
						})
						// #endif
						//储存cookie 2hours
						// let d = new Date()
						// d.setTime(d.getTime() + (2 * 3600 * 1000))
						// document.cookie = 'token' + "=" + escape(response.data.token) + ";expires=" + d.toGMTString()+ ";path=/"
						//cookie截取token
						// let token = document.cookie.substring(6)
						// console.log(token)
						uni.showToast({
							title:"恭喜您,登录成功",
							icon:"none"
						})
						setTimeout(()=>{
							uni.redirectTo({
								url:"../index/index"
							})
						},1100)
					}
				})
			},
		}
	}
</script>

